"note": "<div>\n<i class=\"NoteType\">\nChild Reference Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nDunn County History<br />\nP253\n</p>\n<p>\nMcIntyre Family\n</p>\n<p>\nGrandfather Dougal McIntyre was  born in Grey Countny (Ontario) Canada in 1865. He came to Wisconsin and  worked in  sawmills and farmed east of Boycevilled. He also worked in logging camps. He married Edith Smith, who was born in Indiana in 1867. <br />\nThe Dougal McIntyre's had four children. An Infant son died at birh,  Kathryn was born in 1891  Floyd in  1893 and Mabel in 1895<br />\nKatherine married Martin Olsen in 1911 he farmed and worked on the dray line from Prarie Farm to Menonmine. He also worked in  loggin woods. He bought a farm east of Connorsvilled and they resided there for many years.  THe Martin  Olsons had seven have seven children,  Sylvia,  Edith, Martia, Cora, Elda Jasper and Jean  and twenty two grandchildren.<br />\nFloyd McIntyre married Leona Schlough . He  farmed and worked  for  many years  at the box factory in Downing Wisconsin. Floyd and Leona have five children;  WIlmenr, Ione, Douglas, Janet and  Norma, also fifteen grandchildren. <br />\nWilmer married  Ann Scholl. They have two  children. Marlene  and Kenneth and nine grandchildren. Wilmer worked at Lakeside Aluminum  in  Menomine. He also  farmed and worked at the Stella Cheese Factory Glenwood City and at Interstate Lumber Company Glenwood  City.<br />\nAfter Wilmer and Ann were divorced he married  Cora Olson in 1973.  THey bough a home in Cylon  Wisconsin and lived  there nine years. After selling  it they bought a home jsut east of Connorsville and retired  there.\n</p>\n<p>\nIone  McIntyre married Martin Rye. He farmed and later bough Rye Pumbing and Heating  in  Cumberland Wisconsin.  Martin and Ione  have three Children, Donald,  Steven and Kathy and   six grandchildren. After Martin's death Ione  married Pete Custi of cumberland. He is a partner in Falcon Drill COmpany, Cumberland.\n</p>\n<p>\nDouglas McIntyre  married  Helen Jean Vandien. He was   in military service and has  worked for many years as  a  salesman for  Kolbe  and Kolbe Mill Works. THey have two daughters  Beverly and  Marilyn, also three grandchildren. The douglans McIntyres  live in Boyceville. <br />\nJanet McIntyre married  Leonard St. Angelo. Lenord  was a  dentist in Boycefvilled and Fredric Wisconisn. They have  two daughters, Mickey  and  Lee.   After Leonard  died, Janed married Robert Gazinski of Milwakee. Robert  worked for the Railroad. THey have  three children.  THe Gazinski's live in West Allis Wisconsin.<br />\nNorma McIntyre married  Melvin Slind of Boyceville. He worked as  an engineer for  the  Toni Company St Paul  Minnesota. They have two sons  Jeff  and John . Melvin died  and Norma later married Eugene Williams of Menomine.  THey have  one son  Jamey. Norma is divorced. She has four grandchildren.<br />\nMabel  McIntyre married  Vincent Zebro. He farmed  in the Boyceville area They have Four children, Dennis,  Dorothy, Dale and Vivian. After Mabel  and Vincent  were divorced she  married a Mr Knotts.  Mable now lives with her daughter Dorothy. She has seven grandchildren.\n</p>\n</div>\n</div>",
